import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { InitialConfigComponent } from './initial-config.component'; // Asegúrate de cambiar la ruta al componente real


const routes: Routes = [
  {
    path: '',
    component: InitialConfigComponent, // Ruta raíz del módulo de configuración inicial
    children: [
      // Aquí puedes agregar rutas adicionales para diferentes pasos de configuración
      // Por ejemplo:
      // { path: 'create-master-admin', component: CreateMasterAdminComponent },
      // { path: 'setup-store', component: SetupStoreComponent },
      // ... otras rutas específicas del proceso de configuración inicial
    ],
  },
  // Si es necesario, puedes agregar una ruta de redirección por defecto
  { path: '**', redirectTo: '', pathMatch: 'full' }
];

@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule]
})
export class InitialConfigRoutingModule { }
